import React, {useEffect} from 'react';
import axios from 'axios';
import Header from './contents/components/Header';
import Navbar from "./contents/components/Navbar";
import Posts from "./contents/components/Posts";
import { Div } from './main';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Search from './contents/components/Search';
import Profile from './contents/components/Profile';

function App() {
    const callApi = async () => {
        axios.get('/api').then((res) => console.log(res.data.test));
    };

    useEffect(() => {
        callApi();
    }, []);

  return (
    <Div container>
        <Header />
        <Navbar />
    </Div>
  );
}

export default App;
